AMENDED AND RESTATED 
SHARED FACILITIES AGREEMENT
THIS AMENDED AND RESTATED SHARED FACILITIES AGREEMENT (this “Agreement”), is entered into as of August 26, 2014 (the “Effective Date”), by and between Limon Wind, LLC, a Delaware limited liability company (“Limon I”), Limon Wind II, LLC, a Delaware limited liability company (“Limon I I”) and Limon Wind III, LLC, a Delaware limited liability company (“Limon I II”, and together with Limon  I and Limon II, the “Parties” and each a “Party”).
RECITALS
WHEREAS, Limon   I (an affiliate of Limon II and Limon III) owns and operates (a) a wind energy generation facility with a nameplate capacity of 200 MW (net) (the “Limon   I Project”), and (b) an operations and maintenance building located on the Limon I Project site (the “O&M Building”);
WHEREAS, Limon   II (an affiliate of Limon I and Limon III) owns and operates a wind energy generation facility with a nameplate capacity of 200 MW (net) (the “Limon   II Project”);
WHEREAS, Limon   III (an affiliate of Limon I and Limon II) is developing and will own and operate a wind energy generation facility with a nameplate capacity of 200 MW (net) (the “Limon   III Project”, together with the Limon   I Project and the Limon II Project, the “Projects” and each a “Project”);
WHEREAS, Eastern Colorado Interconnect, LLC (“ECI”, an affiliate of Limon I, Limon I  I and Limon III) entered into a certain Standard Large Generator Interconnection Agreement by and among itself and Public Service Company of Colorado (“PSCo”), dated as of March 8, 2012 (the “Limon I LGIA”), pursuant to which PSCo provides Limon I with certain Interconnection Services (as defined in the Limon I LGIA) for two 200 MW wind generating facilities with an aggregate rated power output of 400 MWs; 
WHEREAS, ECI   owned a 345 kV transmission line (the “Radial Transmission Line”) and certain other personal property, fixtures, equipment and/or facilities (including the Interconnection Customer’s Interconnection Facilities, as defined and identified in Appendix A to the LGIA) described in Exhibit A attached hereto (the “Limon I Shared Facilities”) that are necessary to interconnect the Limon I Project, the Limon II Project and the Limon III Project to the electric transmission system of PSCo;

WHEREAS, pursuant to a Plan of Merger dated as of July 31, 2012, ECI was merged into Limon I and, as a result of said merger, Limon I now owns the Radial Transmission Line, the Limon I Shared Facilities and is a party to the LGIA;

WHEREAS, pursuant to an Assignment and Assumption of Rights to Interconnection Service Under a Standard Large Generator Interconnection Agreement dated as of August 24, 2012, Limon   I assigned to Limon II an interest in the Limon I LGIA affording Limon II the rights to receive Interconnection Services related to the Limon II Project with an aggregate capacity not to exceed 200 MWs;

WHEREAS, on June 17, 2014, Limon III and PSCo entered into a Large Generator Interconnection Agreement (the “Limon III LGIA”) pursuant to which PSCo will provide Limon III certain Interconnection Services (as defined in the Limon III LGIA) for a 200 MW wind generating facility with an aggregate capacity not to exceed 200.6 MWs. 

WHEREAS, Limon II   owns certain personal property, fixtures, equipment and/or facilities (including the Interconnection Customer’s Interconnection Facilities, as defined and identified in Appendix A to the Limon I LGIA) described in Exhibit A attached hereto (the “Limon II Shared Facilities” and jointly with the Limon I Shared Facilities and the O&M Building, the “Existing Facilities”) that are necessary to interconnect the Limon II Project and the Limon III Project to the electric transmission system of PSCo;

WHEREAS, Limon I and Limon II entered into a Shared Facilities Agreement dated August 24, 2012 and a Common Facilities Agreement dated October 30, 2012 (together, the “Prior Agreements”);
WHEREAS, the Limon I and Limon II seek to amend and restate the Prior Agreements in their entirety;
WHEREAS, upon the Effective Date the Parties agree that the Prior Agreements shall be null and void and of no further effect; 
WHEREAS, Limon I and Limon II entered into a Build-Out Agreement (the “BO Agreement”), dated December 10, 2012, which, among other things, provided a Subsequent Phase Owner (as defined in the BO Agreement) certain Subsequent Phase Rights (as defined in the BO Agreement) and obligations with respect to the Existing Facilities, and
WHEREAS, Limon I, Limon II and Limon III are entering into this Amended and Restated Shared Facilities Agreement to allow (i) Limon I, Limon II and Limon III to use the Radial Transmission Line; (ii) Limon I, Limon II and Limon III to use the Existing Facilities; and (iii) Limon II and Limon III to use the Limon II Shared Facilities in order that Limon I, Limon II and Limon III may inject the energy output of the Projects into the electric transmission system of PSCo.
NOW THEREFORE, in consideration of the premises and of the mutual covenants and agreements contained herein, and for other good and valuable consideration, the receipt and sufficiency of which is hereby acknowledged, the Parties hereby agree as follows:
AGREEMENT
TERM; EARLY TERMINATION
Term.  The term of this Agreement shall commence on the Effective Date and shall continue in effect until terminated (a) by mutual agreement of the Parties, or (b) pursuant to Section 1.2 of this Agreement.
Early Termination.  This Agreement shall automatically terminate, without further action by either Party and without further liability of any Party to any other Party (except for obligations accruing prior to the termination), upon the date that each of Limon   I, Limon  II and Limon III, or their successors and assigns, shall have permanently ceased operation of the Projects for the production of electric energy.
GRANT OF SHARED FACILITIES RIGHTS
Grant.  
(i)	During the Term of this Agreement, Limon   I hereby grants to Limon  II and, in a manner consistent with the BO Agreement, to Limon III, on the terms and subject to the conditions hereof, the non-exclusive right to access and utilize the Radial Transmission Line, the Limon I Shared Facilities and the O&M Building as may be reasonably necessary in connection with the Interconnection Services received by Limon II and Limon III from PSCo, and as necessary for the ownership, operation and maintenance of the Limon   II Project and the Limon III Project; provided, Limon III’s use of the O&M Building shall be restricted in the event such use interferes with, or is otherwise incompatible with, the use of the O&M Building by Limon I or Limon II, as determined reasonably by Limon I.
(ii)	During the Term of this Agreement, Limon   II hereby grants to Limon III, in a manner consistent with the BO Agreement, on the terms and subject to the conditions hereof, the non-exclusive right to access and utilize the Limon II Shared Facilities as may be reasonably necessary in connection with the Interconnection Service received by Limon III from PSCo, and as necessary for the ownership, operation and maintenance of the Limon III Project.
Essential Nature.  
(i)	Limon   I hereby acknowledges that the right of   Limon II and Limon III to access and utilize the Radial Transmission Line, the Limon I Shared Facilities and the O&M Building is essential to the production and delivery of electric energy from the   Limon   II Project and the Limon III Project to the electric transmission system of PSCo.
(ii)	Limon I  I hereby acknowledges that the right of   Limon III to access and utilize the Limon II Shared Facilities is essential to the production and delivery of electric energy from the   Limon III Project to the electric transmission system of PSCo.
Vesting.  
(i)	The right to access and utilize the Radial Transmission Line, the Limon I Shared Facilities and the O&M Building granted hereunder by Limon   I to   Limon II and to Limon III shall vest in   Limon II and Limon III as contracting parties hereunder without any transfer of title, leasehold or other interest or rights in the Radial Transmission Line, the Limon I Shared Facilities and the O&M Building.
(ii) 	The right to access and utilize the Limon II Shared Facilities granted hereunder by Limon I  I to   Limon III shall vest in   Limon III as a contracting party hereunder without any transfer of title, leasehold or other interest or rights in the Limon II Shared Facilities.
2.4 	License Fee.  The Parties acknowledge and agree that (i) Limon II has satisfied its obligation to pay to Limon I the License Fee (as defined in the Prior Agreement) associated with the capital costs of the Existing Facilities, and (ii) the BO Agreement provides that a Subsequent Phase Owner (e.g., Limon III) will not be obligated to pay a License Fee with respect to the Existing Facilities; provided, Limon I and Limon II shall not be obligated to pay a pro rata share of the capital costs of any new shared facilities constructed by a Subsequent Phase Owner.

NATURE OF SHARED FACILITIES RIGHTS
Nature of Services.  
(i)	Limon I shall provide certain services to Limon II and Limon III consisting of those Interconnection Services Limon I receives through the Limon I LGIA, as necessary to enable the energy generated by the Limon II Project and the Limon III Project to reach the electric transmission system of PSCo.  The Parties acknowledge that the grant of rights under this Agreement by Limon   I to   Limon II and to Limon III are made for the purpose of enabling the energy from the Limon   II Project and the Limon III Project to reach the transmission system of PSCo.  For the avoidance of doubt, the grant of rights under this Agreement by Limon   I   to Limon II and Limon III shall not relieve Limon I or Limon II of their obligations under the Limon I LGIA.
(ii)	Limon II shall provide certain services to Limon III consisting of those Interconnection Services Limon II receives through the Limon I LGIA, as necessary to enable the energy generated by the Limon III Project to reach the electric transmission system of PSCo.  Limon II and Limon III acknowledge that the grant of rights under this Agreement by Limon I  I to   Limon III is made for the purpose of enabling the energy from the Limon I  II Project to reach the transmission system of PSCo.  For the avoidance of doubt, the grant of rights under this Agreement by Limon   II   to Limon III shall not relieve Limon II of its obligations under the Limon I LGIA
Obligations of Limon I.  Limon I shall exercise its rights and perform its obligations under this Agreement in a manner consistent with its obligations under the Limon I LGIA and the BO Agreement.  Without limiting the generality of the foregoing, during the term of this Agreement, Limon I agrees to:
perform its obligations under this Agreement and the Limon I LGIA in accordance with Good Utility Practice, Applicable Laws and Regulations and Applicable Reliability Standards, in each case as defined in the Limon I LGIA, and in a manner consistent with the terms of the Limon I LGIA;
comply with all provisions of the Limon I LGIA to which it is subject (and all insurance requirements, payments due, operational limits, operating guides, operating procedures and reliability standards and requirements applicable by virtue thereof); 
promptly provide to Limon II and Limon III any notices it receives from PSCo under the Limon I LGIA, including any notices regarding emergencies under Article 13 of the Limon I LGIA;
not take any action, without Limon II’s and Limon III’s written consent, to terminate the Limon I LGIA.  
perform necessary maintenance on the Limon I Shared Facilities, as agreed to in this Agreement; 
ensure that, to the maximum extent practicable, any actions by Limon I that may, or do, cause Limon I to fail to comply with the LGIA, do not affect the service received by Limon II and Limon III hereunder;  
operate the Limon I Project in accordance with Good Utility Practice, Applicable Laws and Regulations and Applicable Reliability Standards, in each case as defined in the Limon I LGIA, and in a manner consistent with the terms of the Limon I LGIA; and
use all commercially reasonable efforts to promptly resolve any technical issues arising in connection with the operation of the Limon I Project that might reasonably be expected to result in a default under the Limon I LGIA. 
Obligations of Limon II. Limon II shall exercise its rights and perform its obligations under this Agreement in a manner that is reasonable and facilitates Limon I’s and Limon III’s performance under, and compliance with, the Limon I LGIA and the BO Agreement.  Without limiting the generality of the foregoing, during the term of this Agreement, Limon II agrees to:
operate the Limon II Project in accordance with Good Utility Practice, Applicable Laws and Regulations and Applicable Reliability Standards, in each case as defined in the Limon I LGIA, and in a manner consistent with the terms of the Limon I LGIA;
facilitate Limon I’s compliance with all provisions of the Limon I LGIA (including, without limitation, all insurance requirements, operational limits, operating guides, operating procedures and reliability standards and requirements applicable by virtue thereof) as related to the Limon II Project;  
not take any action (or refrain from taking any action) which would result in a breach of the Limon I LGIA by Limon I or Limon II;  
use all commercially reasonable efforts to promptly resolve any technical issues arising in connection with the operation of the Limon II Project that might reasonably be expected to result in a default under the Limon I LGIA, and if such default occurs, to promptly assist Limon I to cure such default in accordance with the terms of the Limon I LGIA; 
comply with all instructions, as may be communicated to it by Limon I, in order to ensure compliance with the provisions of the Limon I LGIA with respect to the Limon II Project; 
provide Limon I and Limon III with all reasonable information regarding the operation and condition of the Limon II Project required for Limon I or to maintain compliance with the terms and conditions of the Limon I LGIA; and
provide promptly to Limon I copies of all notices and instructions received by it that affect Limon I’s performance under the Limon I LGIA.
Obligations of Limon III. Limon III shall exercise its rights and perform its obligations under this Agreement in a manner that is reasonable and facilitates Limon I’s and Limon II’s performance under, and compliance with, the Limon I LGIA and the BO Agreement.  Without limiting the generality of the foregoing, during the term of this Agreement, Limon III agrees to:
operate the Limon III Project in accordance with Good Utility Practice, Applicable Laws and Regulations and Applicable Reliability Standards, in each case as defined in the Limon III LGIA, and in a manner consistent with the terms of the III LGIA;
facilitate Limon I’s and Limon II’s compliance with all provisions of the Limon I LGIA (including, without limitation, all insurance requirements, operational limits, operating guides, operating procedures and reliability standards and requirements applicable by virtue thereof) as related to the Limon III Project;  
not take any action (or refrain from taking any action) which would result in a breach by Limon I or Limon II of the Limon I LGIA;  
use all commercially reasonable efforts to promptly resolve any technical issues arising in connection with the operation of the Limon III Project that might reasonably be expected to result in a default under the Limon I LGIA, and if such default occurs, to promptly assist Limon I and Limon II to cure such default under the Limon I LGIA in accordance with the terms of the Limon I LGIA; 
comply with all instructions, as may be communicated to it by Limon I or Limon II, in order to ensure compliance with the provisions of the Limon I LGIA with respect to the Limon III Project; 
provide Limon I and Limon II with all reasonable information regarding the operation and condition of the Limon III Project required for Limon I or Limon II to maintain compliance with the terms and conditions of the Limon I LGIA;
provide promptly to Limon I and Limon II copies of all notices and instructions received by it that affect Limon I’s or Limon II’s performance under the Limon I LGIA, and
comply with the terms and conditions of the BO Agreement as such terms and conditions are applicable to a Subsequent Phase Owner.
No Joint and Several Liability between Limon I, Limon II and Limon III.  The Parties acknowledge and agree that this Agreement does not subject a Party to joint and several liability for any actions taken by any other Party.
Assignment or Transfer of Rights.  Except as set forth in Section 9.6 hereof and except for an assignment or transfer to PSCo, Limon   I, Limon II and Limon III, respectively, shall not assign or transfer any rights granted to such Party hereunder with regard to the Radial Transmission Line, the Limon I LGIA, the Limon I Shared Facilities or the Limon II Shared Facilities, or grant any permission, license, right of way or similar right with regard to the Radial Transmission Line, the Limon I LGIA, the Limon I Shared Facilities or the Limon II Shared Facilities, without the prior written consent of the other Parties.
Interference.  Subject to the terms of this Agreement, in no event shall any Party be entitled to exercise its rights to access and utilize the Radial Transmission Line, the Limon I LGIA, the Limon I Shared Facilities or the Limon II Shared Facilities if the exercise of such rights would materially interfere with or limit the reasonable and necessary access and utilization of the Radial Transmission Line, the Limon I LGIA, the Limon I Shared Facilities or the Limon II Shared Facilities by any other Party. 

Prior Written Consent.  
(i)	Except as set forth in this Agreement, Limon   I shall not take any action that results in the forbearance, foreclosure, termination or alteration of the respective rights or increases the obligations or responsibilities of Limon II or Limon III of access to, utilization of or reliance upon the Radial Transmission Line, the Limon I LGIA, or the Limon I Shared Facilities without the prior written consent of   Limon II and Limon III.  
(ii)	Except as set forth in this Agreement, Limon I  I shall not take any action that results in the forbearance, foreclosure, termination or alteration of the respective rights or increases the obligations or responsibilities of Limon III of access to, utilization of or reliance upon the Limon II Shared Facilities without the prior written consent of   Limon III.  
MAINTENANCE OF SHARED FACILITIES
Allocation of Certain Costs and Expenses.
Limon I shall be responsible for the operation, inspection, maintenance, repair, alteration, relocation, improvement and replacement of Radial Transmission Line, the Limon I Shared Facilities and the O&M Building; provided, however, that the Parties hereby agree that:  (a) the costs and expenses of the operation, inspection, maintenance, repair, alteration, relocation, improvement and replacement of the Radial Transmission Line, the Limon I Shared Facilities and the O&M Building, and of insuring the Radial Transmission Line, the Limon I Shared Facilities and the O&M Building; and (b) costs that Limon I is responsible for under the Limon I LGIA, including potential costs under Section 10.5 therein related to operations and maintenance expenses, and which are not directly caused by each of Limon I, Limon II or Limon III, shall be shared between Limon   I, Limon   II and Limon III on a pro rata basis, with Limon   I paying one third (1/3) of such costs and expenses, Limon   II paying one third (1/3) of such costs and expenses and Limon III paying one third (1/3) of such costs and expenses.    Limon   II and Limon III shall pay their respective allocation (specified above) of such costs and expenses to Limon I within ten (10) days of receipt from Limon I of each written notice specifying such costs and expenses.  Any previous payments between the Parties relating to these costs, fees and expenses shall be applied against payments due under this Section 4.1(i). 
Limon II shall be responsible for the operation, inspection, maintenance, repair, alteration, relocation, improvement and replacement of the Limon II Shared Facilities; provided, however, that Limon II and Limon III hereby agree that the costs and expenses of the operation, inspection, maintenance, repair, alteration, relocation, improvement and replacement of the Limon II Shared Facilities, and of insuring the Limon II Shared Facilities, and which are not directly caused by either Limon II or Limon III, shall be shared between Limon II and Limon III on a pro rata basis, with Limon II paying fifty percent (50%) of such costs and expenses and Limon III paying fifty percent (50%) of such costs and expenses.  Limon III shall pay its respective allocation (specified above) of such costs and expenses to Limon II within ten (10) days of receipt from Limon II of each written notice specifying such costs and expenses.  Any previous payments between the Parties relating to these costs, fees and expenses shall be applied against payments due under this Section 4.1(ii). 

Notwithstanding the foregoing, if the access and usage by Limon III of the Existing Facilities causes an increase in the costs (including operation and maintenance costs) and/or liabilities of Limon I or the Limon II (as determined reasonably by Limon I), Limon III will be solely responsible for such incremental cost increase or liabilities, in a manner consistent with the BO Agreement.

The Parties shall each be liable to pay for the station power service of their respective Projects.

Successor Agreement.  In the event that the Radial Transmission Line, the Limon I LGIA, the Limon I Shared Facilities, the O&M Building or the Limon II Shared Facilities are no longer operated and maintained by a single entity for any reason, the Parties agree to use good faith efforts to negotiate mutually agreeable terms and execute a mutually agreeable agreement (or amendment to this Agreement) that specifies the division of responsibilities of the entities providing operation and maintenance services associated with the Radial Transmission Line, the Limon I LGIA, the Limon I Shared Facilities, the O&M Building or the Limon II Shared Facilities.
CHANGE IN LAW
Change in Law.  In the event that a change in the laws or regulations applicable to the Radial Transmission Line, the Limon I LGIA, the Limon I Shared Facilities, the O&M Building the Limon II Shared Facilities, the Projects or this Agreement requires the amendment, modification or replacement of this Agreement in order to satisfy any applicable federal, state or local regulatory requirements, the Parties agree to use good faith efforts to negotiate and implement mutually agreeable terms to accomplish such amendment, modification or replacement.  
CERTAIN COVENANTS
Authority and Operational Abilities.  Each of the Parties represents, as of the Effective Date, and covenants for the term of this Agreement, that such Party has the legal authority and operational abilities to fulfill its obligations under this Agreement.
Agreement to Cooperate.  Each Party agrees to cooperate reasonably with the other Parties so that, subject to the terms of this Agreement, each Project benefits from the full utilization and enjoyment of the Radial Transmission Line, the Limon I LGIA, the Limon I Shared Facilities or the Limon II Shared Facilities as is necessary for the efficient operation of each such Project.
Adverse Events.  
If an operational issue arises at the Limon I Project, the Limon II Project or the Limon III Project that is reasonably expected to result in a material breach of the Limon I LGIA or this Agreement (an “Adverse Event”), Limon I shall curtail the Project that is causing the Adverse Event.  In the event of such curtailment, energy deliveries to the to the Point of Interconnection (as defined in the Limon I LGIA) from the Project that has caused the Adverse Event shall be limited as necessary  until the Adverse Event has been cured in the reasonable judgment of Limon I.
If, as a direct result of an Adverse Event caused by the Limon I Project, the Limon II Project or the Limon III Project, Limon I incurs costs, expenses, or penalties of any kind (“AE Costs”), Limon I, Limon II or Limon III, as applicable, shall be solely responsible for such AE Costs.  In the event that each of the Projects are responsible for the Adverse Event, and to the extent that Limon I, in its sole and absolute discretion, can accurately allocate responsibility for such Adverse Event between the Projects, Limon I shall be responsible for only its allocable portion of such applicable AE Costs (and Limon I shall allocate the remaining AE Costs to Limon II and Limon III, as appropriate).  If, however, it is not reasonably possible for Limon I, as determined in its sole and absolute discretion, to accurately allocate such responsibility, such AE Costs shall be shared between Limon I, Limon II and Limon III on a pro rata basis, with Limon I paying one third (1/3) of such AE Costs, Limon II paying one third (1/3) of such AE Costs and Limon III paying one third (1/3) of such AE Cost.  
Priority of Curtailment.	Notwithstanding anything to the contrary in this Agreement, in the event of curtailment pursuant to the Limon I LGIA (or pursuant to applicable operating guides or applicable reliability standards and requirements), Limon I shall curtail the Limon I Project, the Limon II Project and the Limon III Project as follows:
first, and if necessary in full, any Project (if any) the operation of which is contributing to a PSCo system emergency; 
second, and if necessary in full, the Limon III Project; and
thereafter, the Limon I Project and the Limon II Project, at the same time and to an extent for each Project equal to such Project’s pro rata portion (based on such Project’s nameplate capacity) of the energy delivered to the Point of Interconnection (assuming, for the avoidance of doubt, the Limon III Project has been curtailed such that it is not delivering any energy to the Point of Interconnection at such time) as of the time immediately prior to the event giving rise to the curtailment.
MATERIAL BREACH; LIMITATIONS
Material Breach by any Party.  In the event of any material breach of this Agreement by any Party and such Party fails to cure promptly such breach within a reasonable time, not to exceed thirty (30) days after receipt of written notice from the non-defaulting Party describing such breach, the non-defaulting Party shall have the right, but not the obligation, in addition to all remedies available to it at law or in equity, to (i) cure the breach on behalf of the defaulting Party, or (ii) suspend the breaching Party’s access to all or any portion of the Radial Transmission Line, the Limon I LGIA, the Limon I Shared Facilities, the O&M Building or the Limon II Shared Facilities owned by such non-breaching Party for so long as such default shall be continuing and remain uncured.  Notwithstanding the foregoing, in the event that a breach of this Agreement could give rise to a breach by Limon I pursuant to the terms of the Limon I LGIA, the non-defaulting Party shall not be required to provide the defaulting Party with notice and/or an opportunity to cure in order to exercise the remedies specified in clause (i) or (ii) above; provided, that the remedy specified in clause (i) may be exercised, without prejudice to any right or remedy of any Party hereunder, by any lender of such Party.  If a Party (or any lender thereof) chooses to cure a Party’s default, the defaulting Party shall reimburse the non-defaulting Party (or such Party’s lender) upon demand for all commercially reasonable costs incurred by the non-defaulting Party (or such Party’s lender) in curing such default. 
Except for indemnification obligations related to third-party claims as provided for in Section 9.7, in no event shall any Party be liable under any provision of this Agreement for any losses, damages, costs or expenses for any special, indirect, incidental, consequential, or punitive damages including, but not limited to, loss of profit or revenue, loss of the use of equipment, cost of capital, cost of temporary equipment or services, whether based in whole or in part in contract, in tort, including negligence, strict liability, or any other theory of liability.
FORCE MAJEURE
Force Majeure.  In the event of an act of God, government order or restraint, war (declared or undeclared) or warlike conditions, act of terrorism, blockade, revolution, strike, lockout, civil commotion, fire, flood, storm, epidemic or any other occurrence beyond a Party’s reasonable control (each a “Force Majeure Event”), such Party shall promptly notify each other Party thereof and, so long as such condition shall persist, such Party shall not be liable for the delay in performance of, or the failure to perform, its obligations (other than obligations for payment of amounts due hereunder) under this Agreement caused directly or indirectly thereby.  The claiming Party shall give each other Party notice describing the particulars of the Force Majeure Event.  Within fifteen (15) days after giving notice of the Force Majeure Event, the claiming Party shall give each other Party an estimate of the Force Majeure Event’s expected duration and probable impact.  The claiming Party shall continue to furnish each other Party with timely regular reports during the continuation of the Force Majeure Event.  Each Party shall promptly exercise commercially reasonable efforts to mitigate or limit the impact to its obligations hereunder as a result of the Force Majeure Event.
MISCELLANEOUS
Relationship of Parties.  The Parties do not intend to create hereby any joint venture, partnership, association or any other entity for the conduct of any business.  Except as provided in Section 7.1, nothing herein shall be deemed to authorize any Party to act on behalf of any other Party.
Non-Interference.  Each Party agrees not to interfere with the reasonable and necessary utilization of the Radial Transmission Line, the Limon I LGIA, the Limon I Shared Facilities or the Limon II Shared Facilities by any other Party as permitted hereunder.
Modification and Amendment.   The terms of this Agreement may only be modified or amended in a writing signed by all of the Parties.
Waiver.  The failure of a Party to insist upon or enforce strict performance of any of the provisions of this Agreement or to exercise any rights or remedies under this Agreement shall not be construed as a waiver or relinquishment to any extent of such Party’s right to assert or rely upon any such provisions, rights, and remedies in that or any other instance; rather, the same shall be and remain in full force and effect.
Enforceability.   Any provision of this Agreement which is prohibited or unenforceable in any jurisdiction shall, as to such jurisdiction, be ineffective only to the extent of such prohibition, but shall be effective to the extent of such remaining provisions hereof.
Assignment.  No Party may assign any of its benefits, rights or obligations hereunder to any third party without the prior written consent of each other Party, provided, however, that any Party may collaterally assign this Agreement to any lender in connection with a financing or a refinancing of its respective Project.
Indemnification.  Each Party shall indemnify, defend and hold each other Party, its officers, directors, shareholders, members and affiliates, harmless from any and all damages, losses, claims, including claims and actions relating to injury to or death of any person or damage to property, demand, suits, recoveries, costs and expenses, court costs, attorney fees, and all other obligations by or to third parties, arising out of or resulting from the indemnifying Party’s performance or non-performance of its obligations under this Agreement, except in cases of gross negligence or intentional wrongdoing, by the indemnified Party. 
Choice of Law, Jurisdiction and Waiver of Jury Trial
(i)	This Agreement and the rights and obligations of the Parties hereunder will be governed pursuant to, and enforced, construed and interpreted in accordance with, the laws of the State of New York without regard to principles of conflicts of laws (other than Section 5-1401 of the General Obligations Law of the State of New York).  Venue for resolution of any disputes under this Agreement shall be New York County, New York.

	(ii)	Each of the Parties irrevocably and unconditionally submits to the exclusive jurisdiction of the United States District Court for the Southern District of New York for the purposes of any suit, action or other proceeding arising out of or relating to this Agreement, the transactions contemplated hereby, any provision hereof or the breach, performance, enforcement or validity or invalidity of this Agreement or any provision hereof (and agrees not to commence any suit, action or proceeding relating thereto except in such courts).  
(iii)	THE PARTIES HERETO EACH HEREBY KNOWINGLY, VOLUNTARILY AND INTENTIONALLY WAIVE THE RIGHT EACH MAY HAVE TO A TRIAL BY JURY WITH RESPECT TO ANY PROCEEDINGS BASED HEREON, OR ARISING OUT OF, UNDER OR IN CONNECTION WITH THIS AGREEMENT, OR ANY COURSE OF CONDUCT, COURSE OF DEALING, STATEMENTS (WHETHER ORAL OR WRITTEN) OR ACTIONS OF EITHER PARTY TO THIS AGREEMENT.  THIS PROVISION IS A MATERIAL INDUCEMENT FOR THE PARTIES TO ENTER INTO THIS AGREEMENT.
Inspection of Records.   Each Party shall have access to any records concerning the Shared Facilities held by any other Party upon reasonable notice and at reasonable times. 
Entire Agreement.  This Agreement constitutes the entire agreement of the Parties with respect to the subject matter hereof.
Section Headings.  The section headings in this Agreement are for convenience of reference only and shall not modify, define, expand, or limit any of the terms or provisions hereof.
Counterparts.  This Agreement may be executed in one or more counterparts, each of which when so executed shall be deemed an original, and all of which when taken together shall constitute one and the same instrument.
Specific Performance.  The Parties hereto may demand specific performance of this Agreement.  Each Party hereby irrevocably waives any defense based on the adequacy of a remedy at law and any other defense which might be asserted to bar the remedy of specific performance.
