EXHIBIT A
TO
SHARED FACILITIES AGREEMENT

Shared Facilities
The “Limon I Shared Facilities” shall consist of the Radial Transmission Line, substation and associated facilities owned by Limon I, but not the collection lines and circuits dedicated to the Limon I Project.  
The “Limon II Shared Facilities” shall consist of the 345 kV radial transmission line, substation and associated facilities owned by Limon II, but not the collection lines and circuits dedicated to the Limon II Project.   
Operations & Maintenance Building and Warehouse:  The operations and maintenance building and warehouse owned or leased by Limon I that is reasonably required by Limon II and Limon III in connection with the operation and maintenance of the Limon II Project and the Limon III Project, respectively.  Also to provide office space for employees and to store equipment and inventory for the Limon Projects together with any replacement, expansions, modifications, improvements (including the water well) or additions to any of the foregoing.
Equipment:  The equipment owned by Limon I that is reasonably required by Limon II and Limon III in connection with the operation and maintenance of the Limon II Project and the Limon III Project, respectively, to include vehicles and the use and replacement of the used spare parts.
Miscellaneous Communications Equipment:  Onsite communications equipment used by Limon I that Limon II and Limon III reasonably require use of in connection with operations of the Limon II Project and the Limon III Project, respectively, together with any replacement, expansions, modifications, improvements or additions to any of the foregoing.
Access Roads, Easements, Permits and Approvals:  The various access roads, easements, permits and approvals (including right-of-way permits and conditional use permits) of Limon I that Limon II and Limon III reasonably require use of in connection with access to and utilization of the Common Facilities and operation of the Limon II Project and the Limon III Project, respectively, together with any operation and maintenance, expansions, modifications, improvements or additions to any of the foregoing.
